import React, { useState, useEffect } from 'react';

import axios from 'axios';
import '../../App.css';
import Footer from '../Footer';
// 
function Users() {
  const [response, setResponse] = useState(null)
  useEffect(() => {
    onClick1(setResponse)
  }, [])
  return (
    <>
        <div>{response?.data?.map(v => v.login+" ")}</div>
        <div>{response?.data[0].name}</div>
        <div>{response?.data[0].email}</div>
    </>
  );
}

export default Users;

const onClick1 = async setResponse =>{
  console.log("1");
